    false,nt"url": null,nt"notes": "Commercially available regional economic
    data for Alaska fisheries [such as IMpact analysis for PLANning (IMPLAN)] are unreliable.
     Therefore, these data need to be either collected or estimated based on more reliable
    information.  These data have been collected or estimated for important economic
    variables such as cost, employment, and factor income (labor income and capital)
    for Alaska fisheries.  The data thus collected or estimated have been used to develop
    regional economic models for Alaska fisheries in order to estimate the economic
    impacts of Alaska fisheries.",nt"license_title": null,nt"extras": [{ntt"key":
